import React from "react";
import { box } from "./box.js";
import "./App.css";

function App() {
  //Initiating the state.
  const [state, stateFunction] = React.useState("State");
  //Function that changes the value of the state.
  function handleClick() {
    stateFunction((prev) => {
      //Ternary operator.
      return prev === "State" ? "No" : "State";
    });
  }
  return (
    <body className="App-body">
      <div className="App">
        <h3>The below is the value of the state.</h3>
        <p onClick={handleClick}>{state}</p>
      </div>
      <box name="Philip Paul" suname="Grima" />
    </body>
  );
}

export default App;
